import React from "react";
import { Text, TouchableOpacity, View } from "react-native";

function CategoryCard({ imgUrl, title }) {
  return (
    <TouchableOpacity>
      <Text>title</Text>
    </TouchableOpacity>
  );
}

export default CategoryCard;
